import React, { useState } from 'react';
import { ThemeProvider, useTheme } from '@mui/material/styles';
import {
  AppBar, Box, Toolbar, MenuItem, Button, Link, IconButton, Menu, TextField, InputAdornment,
  Paper, Grid, Typography, List, ListItem, ListItemText
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import AccountCircle from '@mui/icons-material/AccountCircle';
import Sidebar from '../SideBar/SideBar'; // Make sure the path is correct

const drawerWidth = 240; // Define drawerWidth here, for example, 240px
function stringToBoolean(value) {
  if (typeof value === 'string') {
    const lowerCaseValue = value.toLowerCase();
    if (lowerCaseValue === 'true') {
      return true;
    } else if (lowerCaseValue === 'false') {
      return false;
    }
  }}
const pages = ['Datasets', 'Top Ranked', 'Stock Alerts', 'AI Stock Picks'];

export default function Layout({ children, showSidebar, showAppBar, isAuthenticated }) {
  const theme = useTheme();
  const [anchorEl, setAnchorEl] = useState(null);
  const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = useState(null);
  const [sidebarOpen, setSidebarOpen] = useState(true); // Default to true to be open initially
  const [userName, setUserName] = useState('John Doe'); // Replace with actual user name state

  const isMenuOpen = Boolean(anchorEl);

  const handleProfileMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMobileMenuClose = () => {
    setMobileMoreAnchorEl(null);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
    handleMobileMenuClose();
  };

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  const menuId = 'primary-search-account-menu';
  const renderMenu = (
    <Menu
      anchorEl={anchorEl}
      anchorOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      id={menuId}
      keepMounted
      transformOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      open={isMenuOpen}
      onClose={handleMenuClose}
    >
      <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
      <MenuItem onClick={handleMenuClose}>My account</MenuItem>
      <MenuItem onClick={handleMenuClose}>Logout</MenuItem>
    </Menu>
  );

  const renderTopStocks = () => (
    <List>
      {['AAPL', 'GOOGL', 'MSFT', 'AMZN', 'TSLA'].map((stock) => (
        <ListItem key={stock}>
          <ListItemText primary={stock} />
        </ListItem>
      ))}
    </List>
  );

  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ flexGrow: 1, display: 'flex' }}>
        {showAppBar && (
          <AppBar position="fixed" sx={{ zIndex: theme.zIndex.drawer + 1 }}>
            <Toolbar>
              {showSidebar && (
                <IconButton
                  size="large"
                  edge="start"
                  color="inherit"
                  aria-label="open drawer"
                  onClick={toggleSidebar}
                  sx={{ mr: 2 }}
                >
                  <MenuIcon />
                </IconButton>
              )}
              <TextField
                variant="outlined"
                placeholder="Search Stocks & Crypto"
                sx={{ flex: 1, bgcolor: 'background.paper', borderRadius: 1 }}
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">
                      <SearchIcon />
                    </InputAdornment>
                  ),
                }}
              />
              {pages.map((page) => (
                <MenuItem key={page} sx={{ color: 'WHITE', display: 'block' }}>
                  <Link to={`/${page.toLowerCase().replace(/\s+/g, '')}`} color="inherit">
                    <Typography variant="h9" textAlign="center" sx={{ fontFamily: 'Orbitron' }}> {page} </Typography>
                  </Link>
                </MenuItem>
              ))}
              <Box sx={{ flexGrow: 1 }} />
              {isAuthenticated ? (
                <>
                  <Typography variant="h6" sx={{ marginRight: 2 }}>{userName}</Typography>
                  <IconButton
                    edge="end"
                    aria-label="account of current user"
                    aria-controls={menuId}
                    aria-haspopup="true"
                    onClick={handleProfileMenuOpen}
                    color="inherit"
                  >
                    <AccountCircle />
                  </IconButton>
                </>
              ) : (
                <>
                  <Button  color="neutral"  onClick={() => navigate('/signin')}variant="soft">Sign In</Button>
                  <Button color="inherit" onClick={() => navigate('/register')}>Sign Up</Button>
                </>
              )}
            </Toolbar>
          </AppBar>
        )}
        {renderMenu}
        {showSidebar && <Sidebar open={sidebarOpen} onClose={toggleSidebar} />}
        <Box component="main" sx={{ flexGrow: 1, p: 3, marginTop: showAppBar ? '64px' : '0px' }}>
    <Grid container spacing={2}>
        <Grid item xs={12}>
            <Paper>

                {children}
            </Paper>
        </Grid>
    </Grid>
</Box>

      </Box>
    </ThemeProvider>
  );
}
